import React from 'react'
import styled from "styled-components";
import bgImg from "../assets/img/ho.jpg";

const Sec = styled.section`
position: relative;
padding-bottom: 288px;
background-repeat: no-repeat;
background-size: cover;
background-position: center;
  background-image: url(${bgImg});
`;

const Section = styled.div`
display: block;
@media (min-width: 992px) {
    padding: 7em 0;
  }
`;


const Container1 = styled.div`
width: 100%;
padding-right: 15px;
padding-left: 15px;
margin-right: auto;
margin-left: auto;
@media (min-width: 992px) {
    max-width: 960px;
  }
`;

const Box = styled.div`
-webkit-box-align: center!important;
    -ms-flex-align: center!important;
    align-items: center!important;
display: flex;
-ms-flex-wrap: wrap;
flex-wrap: wrap;
margin-right: -15px;
margin-left: -15px;
`
const Txt = styled.h2`
&:after,
&:before {
  content: "";
  position: absolute;
  bottom: 0;
  height: 2px;
  background: #28a745;
  left: 0;
  -webkit-transform: translateX(-50%);
  -ms-transform: translateX(-50%);
  transform: translateX(-50%);
}
`

const DivLigne = styled.div`

`


const About = () => {
    return (
        <Section id="about" className="site-section" data-aos="fade">
        <Container1 className="container">
          <Box className="row align-items-center">
          <div className="col-md-6 ml-auto">
             <Sec></Sec>
          </div>
            <div className="col-md-5 ml-auto" >
              <DivLigne className="text-left mb-5 section-heading">
                <Txt >Pourquoi le laboratoire Fes ?</Txt>
              </DivLigne>
              <div class="row form-group">
                <div class="col-md-6 mb-3 mb-md-0">
                  <label class="text-black" for="fname">First Name</label>
                  <input type="text" id="fname" class="form-control"/>
                </div>
                <div class="col-md-6">
                  <label class="text-black" for="lname">Last Name</label>
                  <input type="text" id="lname" class="form-control"/>
                </div>
              </div>
              <p>&mdash; <strong className="text-black font-weight-bold">Dr. Jamale esekali</strong>, Fondateur</p>
              <p><a href="https://YOutube.com/28959265" className="popup-youtube text-uppercase">Regarder la video </a></p>
            </div>
          </Box>
        </Container1>
      </Section>
    )
}

export default About
